import axios from 'axios';
import './App.css';
import React, { userState, useEffect } from 'react';


function App() {
  const [org, setOrg] = userState([]);

  useEffect(() => {
    axios.get('api/orgs')
    .then(response => {
      setOrg(response.data);
    })
    .catch(error => {
      console.log(error);
    });
  }, [])

  return (
    <div>
      {org}
    </div>
  );
}

export default App;
